@import url(https://fonts.googleapis.com/css?family=Open+Sans:400,700,300);
@import url('https://fonts.googleapis.com/css?family=Share+Tech+Mono');
@import url('https://fonts.googleapis.com/css?family=Barlow+Semi+Condensed:300,400,500,700');

* {
    font-family: inherit;
    color: inherit;
    font-size: inherit;
    box-sizing: border-box;
}

body {
    background-color: #eeeeee;
    /*background: url('../img/bg.png') no-repeat center center fixed;
    -webkit-background-size: cover;
    -moz-background-size: cover;
    -o-background-size: cover;
    background-size: cover;*/
}

body, html {
    font-family: 'Teko', sans-serif;
    font-size: 16px;
    line-height: 1.5;
    font-weight: 300;
}

img {
    max-width: 100%;
    display: block;
}

a {
    text-decoration: none;
}

h1 {
    font-size: 4em;
    font-weight: 700;
}

h2 {
    font-weight: 700;
}

body {
    background-image: url('../img/bg.png');
    background-position: 50% 50%;
    background-size: cover;
    background-attachment: fixed;
    overflow-x: hidden;
}

.hero {
    height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
    position: relative;
    flex-direction: column;

    box-shadow: inset 0 0 150px 30px #000000;

    background-image: url('../img/zkbg3.png');
    background-position: 50% 0%;
    background-size: cover;
    background-attachment: fixed;

}


.nuclearbg {
    background-image: url('../img/nuclear.png');
    background-position: 50% 50%;
    background-size: cover;
    background-attachment: fixed;
    min-height: 25em;
}

.hero .teaser {
    height: 60%;
    width: 60em;
    max-width: 100%;
    margin: 0 auto;
    padding: 2em;
    padding-top: 3em;
    padding-bottom: 3em;
    min-height: 512px;
}

.hero .teaser .frame {
    height: 100%;
}

.hero img.logo {
    margin-bottom: 3em;
}

.hero .logo_wrap {
    height: 100%;
    width: 38%;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;

}

.betacountdown {
    color: #ffffff;
    font-size: 1em;
    font-weight: lighter;
    text-align: center;
}


.boxes_wrapper {
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    padding: 2em;
    padding-bottom: 0;
}

.boxes_wrapper .box {
    background-color: #000000;
    font-size: 4em;
    line-height: 1em;
    padding: .35em;
    margin: .25em;
    border: 1px solid #222222;
    border-bottom: 3px solid #222222;
    box-shadow: 0px 3px 8px 2px rgba(0, 0, 0, 0.5);
}

.boxes_wrapper .box .desc {
    font-size: .3em;
    text-transform: uppercase;
    height: .15em;
    line-height: 0.3em;
}

.betacountdown p {
    font-size: 1.5em;
    font-weight: lighter;
}

.data_release {
    color: #df1a00;
    font-size: 2em;
    letter-spacing: 1em;
    padding-bottom: 1.5em;
    margin-left: 1em;
}

img.button {
    height: 2.8em;
    width: auto;
    max-width: none;
}

img.button_small {
    height: 2em;
    width: auto;
    max-width: none;
    margin-bottom: .9em;
}

.whitetext {
    color: #ffffff;
}

p.bold {
    font-size: 1.5em;
    font-weight: 700;
    text-shadow: 0px 3px 8px rgba(0, 0, 0, 1);
}

.thirdheight {
    height: 33%;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
}

.thirdheight.bottom {
    width: 100vw;
}

.thirdheight.bottom #hidetimer {
    width: 100vw;
}

.thirdheight.bottom #hidetimer .whitetext {
    font-size: 40px;
    line-height: 1;
    padding: 30px 0 0;
}

.thirdheight.bottom #hidetimer .row {
    display: flex;
    flex-wrap: wrap;
    align-items: center;
    padding-left: 105px;
    padding-right: 105px;
    padding-bottom: 50px;
    position: relative;
}

.thirdheight.bottom #hidetimer .row .logos {
    align-self: center;
    display: flex;
    flex-wrap: wrap;
    align-items: center;
    align-content: center;
    position: absolute;
    left: 105px;
}

.thirdheight.bottom #hidetimer .row .logos img {
    height: 40px;
    width: 40px;
}

.thirdheight.bottom #hidetimer .row .logos .twitter {
    margin-right: 3em;
}

.thirdheight.bottom #hidetimer .row .logos > div {
    margin-right: 1em;
}

.thirdheight.bottom #hidetimer .row .logos .hashtag {
    font-size: 40px;
    line-height: 1;
    padding-top: 10px;
}

.thirdheight.bottom #hidetimer .row .ignibit {
    position: absolute;
    right: 105px;
}

.thirdheight.bottom #hidetimer .row .ignibit img {
    max-height: 70px;
    max-width: 50px;
}

.thirdheight.bottom #hidetimer .row .buttons {
    display: flex;
    flex-wrap: wrap;
}

.thirdheight.bottom #hidetimer .row .buttons img {
    height: 80px;
}

